(51666, 'DA63DDB2-E7DD-4C94-9E8A-BD60E8EAA23E', 'I’m feeling not so good and wrestling a bit on how to work through it. Had a rough night…exasperated by Kiki/Orli disruptions.  It’s just a lot for me to have you be away so long while you are with multiple men over multiple nights…it’s fine…it’s what we have agreed to and have been working on and I don’t in any way want to interfere. But I’m not sure if or how I want to engage with you on an emotional level while you are exploring. ', '678041816171104000', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-06-27T09:56:56.171104'),
(51671, '2D91335E-B43E-402A-9211-5B5A3F3E61BD', 'Ok love. I️ appreciate your candor and sharing how you are feeling. I️t’s hard to be transparent, include you, make sure I’m not skipping any steps, and sharing emotional content in all of the right ways. I️ don’t think you are wanting to punish for doing that but I️ really do hope you don’t withdraw from me. The withdrawing then makes it hard to share. And I️ am committed to that because I️ never want to surprise you. So my humble request is to please not shut me out. I️’m happy I️’m here and I️ really do love sharing with you. This experience is a lot lot more than just the romantic stuff. ', '678042860120216576', '678044432033442048', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2022-06-27T10:14:20.120217'),
(51672, '43A219C4-27F1-46DF-BA0D-8EEFDFFFF619', 'I know it is more than the romantic stuff and I like hearing what you learning and experiencing. I also know this is hard and trying to figure out the right balance is pretty new. We are going to need to experiment. I appreciate your efforts…I truly do. You made me feel good last night', '678045412157692672', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-06-27T10:56:52.157693'),
